import React, { useState, useEffect } from 'react';
import Tour from './Tour';

const Tours = (toursData) => {
  const counter = 9

  return (
    <>
      <h1 className="title">Tours</h1>
        {toursData.data.map(counter => (
          <div>
            <Tour data={toursData.data} />
            {counter ++}
          </div>
        ))}
    </>
  );
};

export default Tours;
